import React from "react";
import axios from "axios"; 
import queryString from "query-string"; 

class Result extends React.Component {
    constructor(props) {
        super(props); 
        this.state= {
            matchedjobs:[], 
        }
    }

    ress = ({ match, location }) => { 
        const API = '/api/results/:';
        const DEFAULT_QUERY =  match.params.skill_name1;
    }
    async componentDidMount() {
        try {
            const res = await axios.get(API+DEFAULT_QUERY);
            console.log(res)
            this.setState({
                matchedjobs: res.data, 
            })
            console.log(this.state.matchedjobs)
        } catch(error){
            console.log(error)
        }
    }
    render() {
        return (
            <div>
            </div>
        )
    }
}

export default Result; 

